from collections import namedtuple
Info = namedtuple('Info', ('name', 'size', 'size64', 'is_float', 'aliases'))

def _regs(size, size64, is_float, regs, Info=Info): 
    return [Info(names[0], size, size64, is_float, names[1:]) for names in [n.split(',') for n in regs.split()]]

