def info(abi):
    return globals()[abi]
    
def _make_by_name(regs):
    res = dict([(r.name.lower(), r) for r in regs])
    for r in regs:
        for alias in r.aliases:
            res[alias.lower()] = r
    return res

_by_name_cache = {}
def info_by_name(abi):
    try:
        return _by_name_cache[abi]
    except KeyError:
        res = _by_name_cache[abi] = _make_by_name(globals()[abi])
        return res
        
def normalise_name(abi, name):
    info = info_by_name(abi)
    try:
        return info[name.lower()].name
    except KeyError:
        return name

